using System; using System.Collections.Generic;  namespace Project3 {     internal class ComparePhone : IComparer<student>     {         List<student> students = new List<student>();          public int Compare(student x, student y)         {             if (x.Phone == null && y.Phone == null) return 0;             else if (x.Phone == null) return -1;             else if (y.Phone == null) return 1;             else return string.Compare(x.Phone, y.Phone, StringComparison.Ordinal);         }     } } 